import React from 'react';
import { Container, Typography, Grid, Card, CardContent, CardMedia, Button } from '@mui/material';

const Home = () => {
  const menuItems = [
    {
      id: 1,
      name: 'Pizza',
      price: 12.99,
      image: 'https://source.unsplash.com/random/300x200/?pizza',
      description: 'Delicious pizza with your favorite toppings'
    },
    {
      id: 2,
      name: 'Burger',
      price: 8.99,
      image: 'https://source.unsplash.com/random/300x200/?burger',
      description: 'Juicy burger with fresh vegetables'
    },
    {
      id: 3,
      name: 'Pasta',
      price: 10.99,
      image: 'https://source.unsplash.com/random/300x200/?pasta',
      description: 'Classic pasta with homemade sauce'
    }
  ];

  return (
    <Container maxWidth="lg" sx={{ mt: 4 }}>
      <Typography variant="h4" component="h1" gutterBottom>
        Our Menu
      </Typography>
      <Grid container spacing={4}>
        {menuItems.map((item) => (
          <Grid item key={item.id} xs={12} sm={6} md={4}>
            <Card>
              <CardMedia
                component="img"
                height="200"
                image={item.image}
                alt={item.name}
              />
              <CardContent>
                <Typography gutterBottom variant="h5" component="h2">
                  {item.name}
                </Typography>
                <Typography variant="body2" color="text.secondary">
                  {item.description}
                </Typography>
                <Typography variant="h6" color="primary" sx={{ mt: 2 }}>
                  ${item.price}
                </Typography>
                <Button variant="contained" color="primary" sx={{ mt: 2 }}>
                  Add to Cart
                </Button>
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>
    </Container>
  );
};

export default Home;
